import React from "react";
import '../Footer/Footer.css';

function Footer() {
  return (
    <footer className="footer">
      <h7 className="footer__title">Учебный проект Яндекс.Практикум х BeatFilm.</h7>
      <div className="footer__block">
      <p className="footer__copyright">&copy; 2023</p>
      <ul className="footer__list">
        <li className="footer__link"><button className="footer__link-button">Яндекс.Практикум</button></li>
        <li className="footer__link"><button className="footer__link-button">Github</button></li>
      </ul>
      </div>
    </footer>
  );
}
export default Footer;
